script: |
  super -f text -I q7655.spq | sort > q7655.out

inputs:
  - name: q7655.spq
    data: |
      SELECT - COUNT ( * ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( - + 69 + + CAST ( + - col1 AS REAL ) + + 89 - - + 54, col0 + - + col0, 60 );
  - name: tab1

outputs:
  - name: q7655.out
    data: |
      -3
